๐ EBITDA ะณััะฟะฟั ะะบัะพะฝ ะฟะพ ะะกะคะ ะฒ 2023 ะณะพะดั ัะพะบัะฐัะธะปะฐัั ะฒะดะฒะพะต, ะดะพ 68,7 ะผะปัะด ััะฑะปะตะน. ะฃัะพะฒะตะฝั ัะตะฝัะฐะฑะตะปัะฝะพััะธ ะฟะพ EBITDA ัะฝะธะทะธะปัั ะดะพ 38% ั 53% ะทะฐ 2022 ะณะพะด. ะััััะบะฐ ัะฟะฐะปะฐ ะฝะฐ 30% ะธ ัะพััะฐะฒะธะปะฐ 179,5 ะผะปัะด ััะฑะปะตะน. ะงะธััะฐั ะฟัะธะฑัะปั ะะบัะพะฝะฐ ัะพะบัะฐัะธะปะฐัั ะฒ 2,5 ัะฐะทะฐ, ะดะพ 35,9 ะผะปัะด ััะฑะปะตะน {$AKRN}

